import '../blogInicio/style.css';
import '../textsFormate/formate.css';

export default function BlogInicio() {
    return (
        <section className="paginaPadrao blog">
            <div className="blog-container">
                <div className="blog-newsletter">
                    <p className="themeOrange">Quer acompanhar minha jornada? Inscreva-se agora!</p>
                    <p>Receba as novidades do blog no seu e-mail.</p>
                    <form>
                        <input type="email" placeholder="Seu e-mail" />
                        <button type="submit">Cadastrar</button>
                    </form>  
                </div> 
            </div>
        </section>
    )
}
